import React from 'react';
import {Text, View, StyleSheet, Image, TextInput, SafeAreaView} from 'react-native';
import {PrimaryButton} from '../../components/button';
import COLORS from '../../components/color';
import {Row, Col} from 'antd';
import { MaterialIcons } from '@expo/vector-icons';

const HeaderUser = () => {
    return (
        <SafeAreaView style={style.container}>
            <View style={style.content}>
                    <Image
                        style={{
                            width: 310,
                            height: 60,
                            flex: 1,
                        }}
                        source={require('../../logo.png')}
                    />
                   <View
                        style={{
                        marginTop: 20,
                        flexDirection: 'row',
                        paddingHorizontal: 20,
                        flex: 3,
                        }}>
                        <View style={style.btnContainerG}>
                        <MaterialIcons name="search" size={28} color={COLORS.p} />
                        <TextInput
                            style={{ paddingLeft: 5, flex: 2, fontSize: 18 }}
                            placeholder="Search"
                        />
                        </View>
                    </View>
                </View>
            </SafeAreaView>
    );
};

const style = StyleSheet.create({
    container: {
        flex: 1,
        height: '100%',
        borderColor: COLORS.grey,
        borderBottomWidth: 2,
        justifyContent: 'center',
        alignItems: 'center',
    },
    content: {
        flex: 1,
        justifyContent: "center",
        flexDirection: 'row',
    },
    textContainer: {
        flex: 1,
        padding: 20,
        justifyContent: 'space-between',
      },
      inputContainer: {
        height: 50,
        width: 290,
        marginBottom: 20,
        borderRadius: 15,
        backgroundColor: COLORS.white,
        shadowRadius: 20,
        elevation: 13,
        shadowColor: COLORS.grey,
        flexDirection: 'row',
        alignItems: 'center',
        justifyContent: 'space-between',
      },
      box: {
        height: 500,
        width: 350,
        marginTop: 20,
        padding: 20,
        backgroundColor: COLORS.white,
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'space-between',
      },
      btnContainerG: {
        backgroundColor: COLORS.yellow,
        height: 60,
        borderRadius: 5,
        justifyContent: 'center',
        alignItems: 'center',
        flexDirection: 'row'
      },
});

export default HeaderUser;
